import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    Navbar:{
        Home: "الرئيسية",
        Chisiamo:"معلومات عننا",
        Servizi:"الخدمات",
        Destinazioni:"الرحلات",
        Proposte:"العروض",
